import Article from './article';

class Blog extends React.Component{
    constructor(props){
        super(props);
        this.state={
            isPublished: false
        }
    }

    render(){
        return(
            <>
                <Article
                    title = {"react"}
                    isPublished ={this.props.isPublished}
                />
            </>
        )
    }
}

export default Blog;
